import { Component } from "react";
import "./homepage.css"

class HomePage extends Component{
    render() {
        return (
             <div className="homepage">
                 <div className="options">
                     <a>Languages</a>
                     <a>Courses</a>
                     <a>Job Position</a>
                 </div>
             </div>
        );
    }
}

export default HomePage;
